int conv_uni_to_pc( long ucs, int usedefault )
{
  int h;
  unsigned short **p1, *p2;
  if ( ucs > 65535 )
    ucs = 65533;
  else
  if ( ucs <= 31 || ucs > 65533 )
  {
    return -1;
  }
  if ( ucs == 65279 || ( ucs > 8202 && ucs <= 8207 ) )
  {
    return -2;
  }
  if ( ( ucs & -512 ) == 61440 )
  {
    return ucs & 511;
  }
  if ( usedefault != 0 )
  {
    if ( unidefault_contents_valid == 0 )
    {
      return -3;
    }
    p1 = unidefault_pagedir[ ucs >> 11 ];
  }
  else
  if ( hashtable_contents_valid == 0 )
  {
    return -3;
  }
  p1 = uni_pagedir[ ucs >> 11 ];
  if ( p1 != 0 )
  {
    p2 = p1[ ( ucs >> 6 ) & 31 ];
    if ( p2 != 0 )
    {
      h = p2[ ucs & 63 ];
      if ( h <= 511 )
      {
        return h;
      }
    }
  }
  return -4;
}
int conv_uni_to_str( char *outbuf, int buflen, long ucs, int usedefault )
{
  char *h;
  char ***p1, **p2;
  if ( ucs > 65535 )
    ucs = 65533;
  else
  if ( ucs <= 31 || ucs > 65533 )
  {
    return -1;
  }
  if ( ucs == 65279 || ( ucs > 8202 && ucs <= 8207 ) )
  {
    return -2;
  }
  if ( usedefault != 0 )
  {
    if ( unidefault_str_contents_valid == 0 )
    {
      return -3;
    }
    p1 = unidefault_pagedir_str[ ucs >> 11 ];
  }
  else
  if ( hashtable_str_contents_valid == 0 )
  {
    return -3;
  }
  p1 = uni_pagedir_str[ ucs >> 11 ];
  if ( p1 != 0 )
  {
    p2 = p1[ ( ucs >> 6 ) & 31 ];
    if ( p2 != 0 )
    {
      h = p2[ ucs & 63 ];
      if ( h != 0 )
      {
        strncpy( outbuf, h, buflen - 1 );
        return 1;
      }
    }
  }
  return -4;
}
